from typing import List

def nxt(a):
    for a in range(a, 10 ** 9):
        s = str(a)
        n = len(s)
        if s[::-1] == s:
            return a


def pre(a):
    for a in range(a, 0, -1):
        s = str(a)
        n = len(s)
        if s[::-1] == s:
            return a
class Solution:
    def minimumCost(self, nums: List[int]) -> int:
        nums.sort()
        _min = min(nums)
        _max = max(nums)
        m = nums[len(nums)//2]
        l,r = m - 1,m + 1
        while str(r) != str(r)[::-1]:
            r += 1
        res1 = sum(abs(r - nums[i]) for i in range(len(nums)))
        while l > 0 and str(l) != str(l)[::-1]:
            l -= 1
        res2 = sum(abs(l - nums[i]) for i in range(len(nums)))
        return min(res1,res2)


    def minimumCost1(self, nums: List[int]) -> int:
        nums.sort()
        # print(nums)
        n = len(nums)
        m = nums[n // 2]
        res = math.inf
        ans = 0
        pa = 0
        for a in range(m, 0, -1):
            s = str(a)
            if s[::-1] == s:
                pa = a
                break
        for i in nums:
            ans += abs(i - pa)
        res = min(res, ans)
        if m == 10 ** 9:
            na = 10 ** 9 - 1
        else:
            na = 0
            for a in range(m, 10 ** 9):
                s = str(a)
                if s[::-1] == s:
                    na = a
                    break
        ans = 0
        for i in nums:
            ans += abs(i - na)
        res = min(res, ans)
        return res
